            <th scope=\"col\">Last name</th>
            <th scope=\"col\">Email</th>
            <th scope=\"col\">Delete</th>
            </tr>
        </thead>
        <tbody>
        {% for user in users %}
            <tr>
            <td>{{loop.index}}</td>
            <td>{{ user.name }}</td>
            <td>{{ user.lastname }}</td>
            <td>{{ user.email }}</td>
            <td><a href=\"{{path('delete_user', {'user': user.id})}}\" onclick=\"return confirm('Are you sure?');\"> <i class=\"fa fa-trash\" aria-hidden=\"true\"></i></a></td>
            </tr>
        {% endfor %}
        </tbody>
        </table>
    </div>

{% endblock %}", "admin/users.html.twig", "/home/nico/Shared/PhpstormProjects/MetubeMaster/Metub/templates/admin/users.html.twig");
